const file = [
    'file1.txt',
    'file2.mp4',
    'file3.jpg'
]

const data = {
    dir: 'root',
    file: file,
    children: [
        {
            dir: 'qwer',
            file: file,
            children: [
                { dir: '1241' },
                { dir: 'sdfa' },
                { dir: 'asd' }
            ]
        },
    ]
}
export default { data }
